import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M14 12a2 2 0 100-4 2 2 0 000 4z", fill: primaryFill }),
        React.createElement("path", { d: "M2 10a4 4 0 014-4h8a4 4 0 010 8H6a4 4 0 01-4-4zm4-3a3 3 0 000 6h8a3 3 0 100-6H6z", fill: primaryFill }));
};
const ToggleRight20Regular = wrapIcon(rawSvg({}), 'ToggleRight20Regular');
export default ToggleRight20Regular;
